import style from "./Nav.module.css";
import { useState } from "react";
import Ac from "@material-ui/icons/Search";
import Mi from "@material-ui/icons/Menu";
import { StyleOutlined } from "@material-ui/icons";
let t = 0;
const Nav = () => {
  const [dis, changedis] = useState(false);
  const [dis2, changedis2] = useState(false);
  const [dis3, changedis3] = useState(false);
  const fun1 = () => {
    changedis(true);
    changedis3(false);
    t = 1;
  };
  const fun2 = () => {
    if (t === 1) {
      changedis(false);
      changedis2(false);
      changedis3(true);
      t = 0;
    }
  };

  const fun3 = () => {
    if (t === 1) {
      changedis2(true);
      changedis3(false);
      t = 0;
    }
  };

  return (
    <div className={style.navmain}>
      <div id={style.navsub}>
        <div id={style.logo} onMouseEnter={fun2}>
          <h1 data-text="TBB">
            <span>TBB</span>
          </h1>
        </div>

        <div className={style.midd2} onMouseEnter={fun2}></div>

        <div id={style.searchbar} onMouseEnter={fun2}>
          <input id={style.navsearch} type="text" />

          <Ac id={style.searchicon} />
        </div>

        <div className={style.midd} onMouseEnter={fun2}></div>

        <div id={style.menubtn}>
          <Mi id={style.mbtn} />
        </div>

        <div id={style.navitems}>
          <div className={style["navitem1"]} onMouseEnter={fun1}>
            <p className={style.paraitem1}>Products</p>
          </div>
          <div id={style.navitem2} onMouseEnter={fun2}>
            <p className={style.paraitem2}>Cart</p>
          </div>
          <div id={style.navitem3} onMouseEnter={fun2}>
            <p className={style.paraitem3}>User</p>
          </div>
        </div>
      </div>
      {dis && (
        <div
          className={style["onHover"]}
          onMouseHover={fun3}
          onMouseLeave={fun2}
        >
          <p className={style.pmen}>Products</p>
          <p>Men</p>

          <hr />
          <p>Women</p>

          <hr />
          <p>Kids</p>
        </div>
      )}
      {dis2 && (
        <div
          className={style["onHover2"]}
          onMouseMoveCapture={fun3}
          onMouseLeave={fun2}
        >
          <p className={style.pmen}>Products</p>
          <p>Men</p>
          <p>Women</p>
          <p>Kids</p>
        </div>
      )}
      {dis3 && (
        <div className={style["onHover3"]}>
          <p className={style.pmen}>Products</p>
          <p>Men</p>
          <p>Women</p>
          <p>Kids</p>
        </div>
      )}
    </div>
  );
};

export default Nav;
